        h1 {
            text-align: center;
            font-size: 35px;
            color:#1E90FF ;
        }

        .container {
            width: 80%;
            margin: 0 auto;
            padding-#1E90FFtop: 5px;
        }

        .conversation-label,
        .response-label {
            color: #0077B6;
            font-size: 16px;
            font-weight: bold;
            margin-bottom: 2px;
        }

       .input-box {
    width: 100%;
    height: 50px;
    font-family: Arial, sans-serif;
    font-size: 16px;
    background-color: rgba(173, 216, 230, 0.4); /* rgba */
    border: 2px solid lightblue;
    border-radius: 5px;
    padding: 3px;
    resize: none;
    outline: none;
    color:  blue;
}

.response-box {
    width: 100%;
    height: 115px;
    font-family: Arial, sans-serif;
    font-size: 15px;
    background-color: rgba(173, 216, 230, 0.4); /* rgba */
    border: 2px solid lightblue;
    border-radius: 5px;
    padding: 10px;
    resize: none;
    overflow-y: auto;
    margin-bottom: 2px;
    outline: none;
}

        .button-container {
            display: flex;
            justify-content: center;
            margin-top: 2px;
        }

        .button {
            width: 100px;
            display: inline-block;
            background-color: lightblue;
            color: white;
            padding: 10px 20px;
            text-align: center;
            text-decoration: none;
            font-size: 15px;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            margin: 0 40px;
        }

        .button:hover {
            background-color: blue;
        }

        .clear-button {
            background-color: lightblue;
        }

        .clear-button:hover {
            background-color: red;
        }

        .author-info {
            position: fixed;
            top: 15px;
            right: 15px;
            color: gold;
            font-size: 10px;
            background-image: linear-gradient(45deg, #00bcd4, #ff4081);
            padding: 10px 20px;
            border-radius: 50px;
            text-transform: uppercase;
            font-family: "Arial", sans-serif;
            animation: glow 2s ease-in-out infinite alternate;
        }

        @keyframes glow {
            from {
                box-shadow: 0 0 5px #00bcd4, 0 0 20px #00bcd4, 0 0 30px #00bcd4;
            }
            to {
                box-shadow: 0 0 20px #00bcd4, 0 0 40px #00bcd4, 0 0 60px #00bcd4;
            }
        }

        .author-info a {
            color: #fff;
            text-decoration: none;
        }
.checkbox-container {
  display: flex;
  align-items: center;
}

.checkbox-container input[type="checkbox"] {
  margin-right: 8px;
  appearance: none;
  -webkit-appearance: none;
  width: 22px;
  height: 22px;
  border: 2px solid blue;
  border-radius: 4px;
  outline: none;
  cursor: pointer;
}

.checkbox-container input[type="checkbox"]:checked {
  background-color: #2196F3;
  border-color: #2196F3;
}

.checkbox-container input[type="checkbox"]:checked::before {
  content: "";
  position: absolute;
  top: 4px;
  left: 8px;
  width: 8px;
  height: 12px;
  border-right: 2px solid blue;
  border-bottom: 2px solid blue;
  transform: rotate(45deg);
}

.checkbox-container label {
  font-size: 16px;
}

/*  */
.user-message {
    color: blue; /*  */
}

/* GPT */
.gpt-response {
    color: #ff4500; /*  */
}
.input-box::placeholder {
    color: lightgreen; 
}
</style>
</head>
<body>
<div class="container">
<h1>GPT-3.5-turbo</h1>
<div>
<label class="conversation-label"> </label><br>
<input type="text" id="system-message" class="input-box" placeholder="gpt">
</div>
<div>
<label class="conversation-label"> </label><br>
<textarea id="user-input" class="input-box" placeholder=""></textarea>
</div>
<div>
<label class="conversation-label">GPT5</label><br>
<select id="model-select" class="input-box">
{% for key, value in models.items() %}
<option value="{{ key }}">{{ value }}</option>
{% endfor %}
</select>
</div>
<div>
<label class="conversation-label">Temperature</label><br>
<input type="float" id="temperature" class="input-box" placeholder=">=000-1">
</div>
<div>
<label class="conversation-label">Max-Tokens</label><br>
<input type="int" id="max-tokens" class="input-box" placeholder="4000/160004000">
</div>
<div>
  <div class="checkbox-container">
    <label for="continuous-chat" class="conversation-label"> </label>
    <input type="checkbox" id="continuous-chat">
  </div>
</div>
<div>
<label class="response-label"> </label><br>
<!--  -->
<div id="response-text" class="response-box"></div>
</div>
<br>
<div class="button-container">
<button id="send-button" class="button"></button>
<button id="clear-button" class="button clear-button"></button>
</div>
<!-- base64 -->
<audio id="notification-audio" preload="auto">
<source src="data:audio/mp3;base64,base64" type="audio/mp3" />
</audio>
</div>
<div class="author-info"></div><script>

  document.addEventListener("DOMContentLoaded", function(event) {
    // 
    document.getElementById("system-message").value = "You are a helpful assistant.";
    document.getElementById("temperature").value = "0.3";
    document.getElementById("max-tokens").value = "3500";
  });

   document.getElementById("send-button").addEventListener("click", function () {
        // 
        var user_input = document.getElementById("user-input").value;
        var selected_model = document.getElementById("model-select").value;
        var system_message = document.getElementById("system-message").value;
        var temperature = parseFloat(document.getElementById("temperature").value);
        var max_tokens = parseInt(document.getElementById("max-tokens").value);
        var continuous_chat = document.getElementById("continuous-chat").checked; // 

	// 
    if (user_input === "") {
        alert("");
        return; // 
    }

        // 
        fetch("/get_response", {
            method: "POST",
            body: new URLSearchParams({
                user_input: user_input,
                selected_model: selected_model,
                system_message: system_message,
                temperature: temperature,
                max_tokens: max_tokens,
                continuous_chat: continuous_chat  // 
            }),
            headers: {
                "Content-Type": "application/x-www-form-urlencoded"
            }
        })
